<div class="entities" style="line-height: 2.5; direction: ltr">Suppression of 3 - deoxyglucosone and heparin-binding epidermal growth factor-like growth factor mRNA expression by an aldose reductase inhibitor in rat vascular smooth muscle cells . Reactive carbonyl compounds and oxidative stress have been recently shown to up-regulate the expression of heparin-binding epidermal growth factor-like growth factor ( HB - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01133
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , a potent mitogen for vascular smooth muscle cells ( SMCs ) produced by SMC themselves . Because the polyol pathway has been reported to influence the formation of carbonyl compounds and the oxidative stress in various cells , we conducted this study to investigate whether the polyol pathway affects HB - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01133
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression along with the generation of carbonyl compounds and the oxidative stress in SMCs . We found that , compared with those cultured with 5.5 mM glucose , SMCs cultured with 40 mM glucose showed the accelerated thymidine incorporation , elevated levels of intracellular sorbitol , 3 - deoxyglucosone ( 3 - DG ) , advanced glycation end products ( AGEs ) , and thiobarbituric acid-reactive substances ( TBARS ) along with the enhanced expression of HB -

 mRNA . An aldose reductase inhibitor (

 ) , Q9NYY3 - 860 , significantly inhibited all of these abnormalities , while aminoguanidine suppressed 3 - DG levels and HB -

<div class="entities" style="line-height: 2.5; direction: ltr">Adipocyte pseudohypoxia suppresses lipolysis and facilitates benign adipose tissue expansion . Prolyl hydroxylase enzymes ( PHDs ) sense cellular oxygen upstream of hypoxia-inducible factor ( HIF ) signaling , leading to HIF degradation in normoxic conditions . In this study , we demonstrate that adipose Q9GZT9 inhibition plays a key role in the suppression of adipocyte lipolysis . Adipose Phd 2 gene ablation in mice enhanced adiposity , with a parallel increase in adipose vascularization associated with reduced circulating nonesterified fatty acid levels and normal glucose homeostasis . Phd 2 gene-depleted adipocytes exhibited lower basal lipolysis in normoxia and reduced -adrenergic-stimulated lipolysis in both normoxia and hypoxia . A selective P20941 inhibitor suppressed lipolysis in murine and human adipocytes in vitro and in vivo in mice . Q9GZT9 genetic ablation and pharmacological inhibition attenuated protein levels of the key lipolytic effectors hormone-sensitive lipase and adipose triglyceride lipase ( Q96AD5 ) , suggesting a link between adipocyte oxygen sensing and fatty acid release . Q9GZT9 mRNA levels correlated positively with mRNA levels of AB-hydrolase domain containing - 5 , an activator of Q96AD5 , and negatively with mRNA levels of lipid droplet proteins , perilipin , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 in human subcutaneous adipose tissue . Therapeutic pseudohypoxia caused by Q9GZT9 inhibition in adipocytes blunts lipolysis and promotes benign adipose tissue expansion and may have therapeutic applications in obesity or lipodystrophy .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">A mechanism for the synergistic antimalarial action of atovaquone and proguanil . A combination of atovaquone and proguanil has been found to be quite effective in treating malaria , with little evidence of the emergence of resistance when atovaquone was used as a single agent . We have examined possible mechanisms for the synergy between these two drugs . While proguanil by itself had no effect on electron transport or mitochondrial membrane potential ( DeltaPsim ) , it significantly enhanced the ability of atovaquone to collapse DeltaPsim when used in combination . This enhancement was observed at pharmacologically achievable doses .

</mark>
 acted as a biguanide rather than as its metabolite cycloguanil ( a parasite dihydrofolate reductase [

</mark>
 inhibitor , pyrimethamine , also had no enhancing effect . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01131
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 - mediated enhancement was specific for atovaquone , since the effects of other mitochondrial electron transport inhibitors , such as myxothiazole and antimycin , were not altered by inclusion of proguanil . Surprisingly , proguanil did not enhance the ability of atovaquone to inhibit mitochondrial electron transport in malaria parasites . These results suggest that proguanil in its prodrug form acts in synergy with atovaquone by lowering the effective concentration at which atovaquone collapses DeltaPsim in malaria parasites . This could explain the paradoxical success of the atovaquone-proguanil combination even in regions where proguanil alone is ineffective due to resistance . The results also suggest that the atovaquone-proguanil combination may act as a site-specific uncoupler of parasite mitochondria in a selective manner .</div>

 mutations and the response to mexiletine in long-QT syndrome type 3 patients . BACKGROUND :

</mark>
 ( Mex ) has been proposed as a gene-specific therapy for patients with long-QT syndrome type 3 ( LQT 3 ) caused by mutations in the cardiac sodium channel gene ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) . The degree of QT shortening and the protection from arrhythmias vary among patients harboring different mutations . We tested whether the clinical response to Mex in LQT 3 could be predicted by the biophysical properties of the different mutations . METHODS AND RESULTS : We identified 4 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 mutations in 5 symptomatic LQT 3 patients with different responses to Mex ( 6 to 8 mg . kg ( - 1 ) . d ( - 1 ) ) . We classified the mutations as sensitive to Mex ( P1332L , R1626P ; &gt; /= 10 % of QTc shortening and QTc &lt; 500 ms or no arrhythmias ) or insensitive to Mex ( S941N , M1652R ; negligible or no QTc shortening and sudden death ) . We measured Na ( + ) current from

 293 cells transfected with wild-type ( WT ) or mutant Nav 1.5 . All mutations showed impaired inactivation of Na ( + ) current , but the mutations identified in patient responders to Mex ( P1332L , R1626P ) showed a hyperpolarizing shift of V ( 1/2 ) of steady-state inactivation . Furthermore , Mex produced use-dependent block with the order R1626P =P 1332L &gt; S941N = WT &gt; M1652R , suggesting that Mex-sensitive mutants present prolonged recovery from Mex block . CONCLUSIONS : We propose that voltage dependence of channel availability and shifts of V ( 1/2 ) of steady-state inactivation correlate with the clinical response observed in LQT 3 patients . This supports the view that the response to Mex is mutation specific and that in vitro testing may help to predict the response to therapy in LQT 3 .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Establishment of a cell-based drug screening model for identifying agonists of human peroxisome proliferator-activated receptor gamma ( PPAR ) . OBJECTIVES : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( PPAR ) plays a critical role in regulation of diverse biological processes , including lipid metabolism and adipogenesis , cell division and apoptosis , and is involved in variety of disease conditions , such as obesity , atherosclerosis , inflammation and tumour . Developing a cell-based reporter gene model targeting PPAR would be useful to screen human PPAR agonists that could be beneficial to patients with these diseases . METHODS : We stably co-transfected human embryonic kidney ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) cell line 293T cells with phPPAR-IRES 2 - EGFP vector to express human PPAR ( hPPAR ) , a reporter vector pPPRE  3 - TK-LUC , and control vector pRL-CMV . The efficiency of the co-transfection was evaluated with flow cytometry of hPPAR expressing cells . Specificity of hPPAR activity was determined by dual luciferase reporter assay of co-transfected cells exposed to PPAR agonist rosiglitazone , PPAR agonist WY14643 and retinoic acid receptor alpha ( RAR ) agonist all-trans-retinoic acid ( DB00755 ) . KEY FINDINGS : The phPPAR-IRES 2 - EGFP co-transfected HEK 293T cells showed concentration - and time-dependent luciferase induction upon exposure to the rosiglitazone , while WY14643 and DB00755 were unable to activate the co-transfected HEK 293T cells . CONCLUSIONS : These data indicated that the HEK 293T cells could be stably transfected with hPPAR . This cell-based drug screening platform could be used targeting specific nuclear receptor of hPPAR with effectiveness and specificity for hPPAR agonists discovery .</div>

 is dispensable for oxygen sensing in vivo . Prolyl - 4 - hydroxylation is necessary for proper structural assembly of collagens and oxygen-dependent protein stability of hypoxia-inducible transcription factors ( HIFs ) . In vitro function of HIF prolyl - 4 - hydroxylase domain ( P20941 ) enzymes requires oxygen and 2 - oxoglutarate as cosubstrates with iron ( II ) and vitamin C serving as cofactors . Although vitamin C deficiency is known to cause the collagen-disassembly disease scurvy , it is unclear whether cellular oxygen sensing is similarly affected . Here , we report that vitamin C-deprived Gulo ( - / - ) knockout mice show normal HIF-dependent gene expression . The systemic response of Gulo ( - / - ) animals to inspiratory hypoxia , as measured by plasma erythropoietin levels , was similar to that of animals supplemented with vitamin C . Hypoxic HIF induction was also essentially normal under serum - and vitamin C-free cell-culture conditions , suggesting that vitamin C is not required for oxygen sensing in vivo . Glutathione was found to fully substitute for vitamin C requirement of all 3 P20941 isoforms in vitro . Consistently , glutathione also reduced HIF - 1 protein levels , transactivation activity , and endogenous target gene expression in cells exposed to CoCl ( 2 ) . A Cys 201Ser mutation in Q9GZT9 increased basal hydroxylation rates and conferred resistance to oxidative damage in vitro , suggesting that this surface-accessible Q9GZT9 cysteine residue is a target of antioxidative protection by vitamin C and glutathione .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Mass spectrometric analysis of agonist effects on posttranslational modifications of the beta - 2 adrenoceptor in mammalian cells . Posttranslational modifications ( PTMs ) of the beta - 2 adrenoceptor (

 ) play a fundamental role in receptor regulation by agonists . We have examined the effects of several agonists on net levels of

 palmitoylation and phosphorylation using epitope tagging in stably transfected human embryonal kidney ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) 293 cells , immunoaffinity purification , and mass spectrometry combined with the method of stable isotope labeling by amino acids in cell culture ( SILAC ) . Palmitoylation of Cys 341 was confirmed and did not change detectably after 30 min exposure of cells to saturating concentrations of dopamine , epinephrine , or isoproterenol . However , all of these agonists produced a marked increase in net phosphorylation . Phosphorylation of the third cytoplasmic loop was increased to a similar degree by all three agonists , whereas differences between agonists were observed in net phosphorylation of the carboxyl-terminal cytoplasmic domain ( isoproterenol approximately epinephrine &gt; &gt; dopamine ) . Interestingly , agonist-induced phosphorylation of the carboxyl-terminal cytoplasmic domain was observed exclusively in a proximal portion ( between residues 339-369 ) . None of the agonists produced detectable phosphorylation in a distal portion of the cytoplasmic tail , which contains all sites of agonist-induced phosphorylation identified previously by in vitro reconstitution . These results provide insight to agonist-dependent regulation of the

 in intact cells , suggest the existence of significant differences in regulatory phosphorylation events occurring between in vitro and in vivo conditions , and outline a general analytical approach to investigate regulated PTM of receptors in mammalian cells .</div>
